import  uuid  from 'react-uuid';

export const myTodos = [
    {
        id: 0,
        name: 'Learn React',
        completed: false,
    },
    {
        id: uuid(),
        name: 'Learn Firebase',
        completed: false
    },
    {
        id: uuid(),
        name: 'Learn Node',
        completed: false
    }
]
